import React from 'react';
import '../styles/Competence.css';

const competenceData = [
  {
    id: 1,
    icon: '🖥️', // Substitua pelos ícones desejados ou use um pacote de ícones
    title: 'Web Development',
    description: 'Experience in front-end and back-end, including HTML, CSS, JavaScript, and frameworks like React and Node.js.',
  },
  {
    id: 2,
    icon: '🔧', // Substitua pelos ícones desejados ou use um pacote de ícones
    title: 'Technical Support',
    description: 'Expert in resolving technical issues and providing high-quality support for users and teams.',
  },
  {
    id: 3,
    icon: '📊', // Substitua pelos ícones desejados ou use um pacote de ícones
    title: 'Systems Analysis',
    description: 'Ability to analyze and improve systems to ensure efficiency and effectiveness.',
  },
];

const Competence = () => {
  return (
    <section id="competence">
      <header>
        <h2>My Competences</h2>
      </header>
      <div className="cards">
        {competenceData.map((competence) => (
          <div key={competence.id} className="card">
            <div className="icon">{competence.icon}</div>
            <h3>{competence.title}</h3>
            <p>{competence.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Competence;
